'use strict';(function(){const indexCfg={cache:true};indexCfg.doc={id:'id',field:['title','content'],store:['title','href','section'],};const index=FlexSearch.create('balance',indexCfg);window.bookSearchIndex=index;index.add({'id':0,'href':'/docs/unlocking-the-harvester/','title':"1 Unlocking The Harvester",'section':"Index",'content':"Unlocking The Harvester #  When you recive the harvester zipfile, within in the file you\u0026rsquo;ll find a licence.key file.\nThis will be a string that should look something like this f4b038a5-110d-4f34-8e9b-afdb2090ba82.\nTo access the full power of the harvester you\u0026rsquo;ll have to first import the unlock function and\nproceed as so:\nimport harvester err = harvester.unlock(\u0026#39;f4b038a5-110d-4f34-8e9b-afdb2090ba82\u0026#39;) if err: raise RuntimeError(err) from harvester import Harvester, ReCaptchaV2 In addition to validating the licence key, calling unlock will also\nmake sure you have the most recent version of the harvester avaliable.\nYou should call this everytime before you start using the harvester.\nHowever, it will work without it for a couple of days until the copy\nit downloads and expires.\n"});index.add({'id':1,'href':'/docs/recaptcha-v2-example/','title':"2.1 ReCaptcha v2 Example",'section':"Index",'content':"ReCaptcha v2 Example #  This guide shows how to setup the harvester to collect tokens for Google\u0026rsquo;s ReCaptcha v2.\nNOTE: This example assumes you have already unlocked the harvester. For more information\non that see here\nfrom harvester import Harvester, ReCaptchaV2 captcha = ReCaptchaV2( url=\u0026#39;www.supremenewyork.com\u0026#39;, sitekey=\u0026#39;6LeWwRkUAAAAAOBsau7KpuC9AV-6J8mhw4AjC3Xz\u0026#39; ) harvester = Harvester().serveforever() intercepter = harvester.capture(captcha) Next, take a look at configuring the browser and getting to the actual harvesting of the captcha tokens here\n"});index.add({'id':2,'href':'/docs/recaptcha-v3-example/','title':"2.2 ReCaptcha v3 Example",'section':"Index",'content':"ReCaptcha v2 Example #  This guide shows how to setup the harvester to collect tokens for Google\u0026rsquo;s ReCaptcha v3.\nNOTE: This example assumes you have already unlocked the harvester. For more information\non that see here\nfrom harvester import Harvester, ReCaptchaV3 captcha = ReCaptchaV3( url=\u0026#39;https://recaptcha-demo.appspot.com/recaptcha-v3-request-scores.php\u0026#39;, sitekey=\u0026#39;6LdyC2cUAAAAACGuDKpXeDorzUDWXmdqeg-xy696\u0026#39;, action=\u0026#39;examples/v3scores\u0026#39; ) harvester = Harvester().serveforever() intercepter = harvester.capture(captcha) Next, take a look at configuring the browser and getting to the actual harvesting of the captcha tokens here\n"});index.add({'id':3,'href':'/docs/hcaptcha-example/','title':"2.3 hCaptcha Example",'section':"Index",'content':"ReCaptcha v2 Example #  This guide shows how to setup the harvester to collect tokens for hCaptchas.\nNOTE: This example assumes you have already unlocked the harvester. For more information\non that see here\nfrom harvester import Harvester, hCaptcha captcha = hCaptcha( url=\u0026#39;www.sotostore.com\u0026#39;, sitekey=\u0026#39;33f96e6a-38cd-421b-bb68-7806e1764460\u0026#39; ) harvester = Harvester().serveforever() intercepter = harvester.capture(captcha) Next, take a look at configuring the browser and getting to the actual harvesting of the captcha tokens here\n"});index.add({'id':4,'href':'/docs/opening-the-browser/','title':"3 Opening The Browser",'section':"Index",'content':"Opening The Browser #  This guide shows you how to launch a browser instance after getting an intercepter\ninstance back from harvester.capture.\nQuick Recap #  We\u0026rsquo;ll be using a ReCaptchaV2 in this example, but you are able to pass any of the\ncaptcha configs and the browser API will work in the exact same way.\nfrom harvester import Harvester, ReCaptchaV2 captcha = ReCaptchaV2( url=\u0026#39;www.supremenewyork.com\u0026#39;, sitekey=\u0026#39;6LeWwRkUAAAAAOBsau7KpuC9AV-6J8mhw4AjC3Xz\u0026#39; ) harvester = Harvester().serveforever() intercepter = harvester.capture(captcha) You\u0026rsquo;ll probaby recognize the code above as being pulled straight from the ReCaptcha V2 Example!\nNow lets get to setting up the browser.\nbrowser = intercepter.setup_browser(user_data_dir=\u0026#39;ChromeData\u0026#39;) The code above will return a new Browser instance. Keep in mind that calling\nsetup_browser again will return the same instance it returned the first time.\nThis might change in the future.\nThe user_data_dir can be a path to an existing user-data-dir, or it can be to\na folder than doesn\u0026rsquo;t exist yet, in which case the folder will be created. Make\nsure any parent folders have already been created though.\nNow we\u0026rsquo;ll have to get access to a Profile object to actually lauch a window.\nA Simple Example #  # check to see if any profiles exist already if not browser.get_profiles(): # create a new profile profile = browser.new_profile(\u0026#39;Foo\u0026#39;) # this will open a window which allows the user to login to google # it will block until the user close the browser, browser, not the window profile.login_to_google() else: # load the profile that should exist after running the code a second time profile = browser.get_profile(\u0026#39;Foo\u0026#39;) # this will create a window which will connect to the server # and display captcha\u0026#39;s to the user when they are requested # later in in the code profile.harvest() Loops For The Win #  Using the power of the for loop, we\u0026rsquo;ll initiate a couple of profiles, log them\ninto Google, and then open them to start harvesting ReCaptcha v2 tokens.\n# check to see if any profiles exist already existing_profiles = len(browser.get_profiles()) if existing_profiles \u0026lt; 6: for i in range(existing_profiles - 6): profile = browser.new_profile(f\u0026#39;Foo-{i}\u0026#39;) profile.login_to_google() for profile in browser.get_profiles(): profile.harvest() The code above will open at least 6 windows unless more than 6 profiles\nalready existed before running the code.\nUsing Proxies #  To setup a proxy all you need to do is:\nfrom harvester import Proxy proxy = Proxy( host=\u0026#39;127.0.0.1, port=9487 ) Authenicated Proxies #  To use authenicated proxies, all you need to do is\npass a username and password like:\nproxy = Proxy( host=\u0026#39;127.0.0.1, port=9487, username=\u0026#39;foo\u0026#39;, password=\u0026#39;bar\u0026#39; ) Setting The Proxy #  To actually set a proxy in a profile, all you need to do is call\n.set_proxy.\nproxy = Proxy( host=\u0026#39;127.0.0.1, port=9487 ) if not browser.get_profiles(): profile = browser.new_profile(\u0026#39;Foo\u0026#39;) profile.set_proxy(proxy) # from now on all requests will be proxied profile.login_to_google() else: # set proxy is setup for chaining so you can use it like this too profile = browser.get_profile(\u0026#39;Foo\u0026#39;).set_proxy(proxy) profile.harvest() Finally, we are ready to access the tokens!\n"});index.add({'id':5,'href':'/docs/accessing-the-tokens/','title':"4 Accessing The Tokens",'section':"Index",'content':"Accessing The Tokens #  This guide shows you how to request tokens after launching a browser window.\nWhile this can be done before launching a browser, it wouldn\u0026rsquo;t make much\nsense since there would be no way for the user to solve the captchas.\nHere is a simple example that will wait for the user to press enter before\nrequesting a token. After receiving it, the token it printed to the screen.\nintercepter = harvester.capture(captcha) while True: input(\u0026#39;\u0026gt; \u0026#39;) token = intercepter.tokens.get() print(token) "});index.add({'id':6,'href':'/docs/','title':"Index",'section':"",'content':"          Welcome to the harvester\u0026rsquo;s documentation.\nCheck out the sidebar to read up on how things work around here. If you\nnotice, each entry has been numbered in the order that you\u0026rsquo;d most likely\nneed to understand them in.\nIf you have any questions feel free to DM me on Discord @MacHacker#7322\nor join the Discord server by clicking the badge above.\nStatus #  Currently the Harvester is still under development but the beta will be\nout soon. If you are interested in being a part of the beta, PM me over\nDiscord.\nPartners #   Coming Soon\u0026hellip;  "});})();